import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import "../Inthewomb/Slick.css";
import week1 from "../images/Pregnancy by week/1-week-pregnant.png";
import week2 from "../images/Pregnancy by week/2-week-pregnant.png";
import week3 from "../images/Pregnancy by week/3-week-pregnant.png";
import week4 from "../images/Pregnancy by week/4-week-pregnant.png";
import week5 from "../images/Pregnancy by week/5-week-pregnant.png";
import week6 from "../images/Pregnancy by week/6-week-pregnant.png";
import week7 from "../images/Pregnancy by week/7-week-pregnant.png";
import week8 from "../images/Pregnancy by week/8-week-pregnant.png";
import week9 from "../images/Pregnancy by week/9-week-pregnant.png";
import week10 from "../images/Pregnancy by week/10-week-pregnant.png";
import week11 from "../images/Pregnancy by week/11-week-pregnant.png";
import week12 from "../images/Pregnancy by week/12-week-pregnant.png";
import week13 from "../images/Pregnancy by week/13-week-pregnant.png";
import week14 from "../images/Pregnancy by week/14-week-pregnant.png";
import week15 from "../images/Pregnancy by week/15-week-pregnant.png";
import week16 from "../images/Pregnancy by week/16-week-pregnant.png";
import week17 from "../images/Pregnancy by week/17-week-pregnant.png";
import week18 from "../images/Pregnancy by week/18-week-pregnant.png";
import week19 from "../images/Pregnancy by week/19-week-pregnant.png";
import week20 from "../images/Pregnancy by week/20-week-pregnant.png";
import week21 from "../images/Pregnancy by week/21-week-pregnant.png";
import week22 from "../images/Pregnancy by week/22-week-pregnant.png";
import week23 from "../images/Pregnancy by week/23-week-pregnant.png";
import week24 from "../images/Pregnancy by week/24-week-pregnant.png";
import week25 from "../images/Pregnancy by week/25-week-pregnant.png";
import week26 from "../images/Pregnancy by week/26-week-pregnant.png";
// import week27 from "../images/Pregnancy by week/27-week-pregnant.png";
// import week28 from "../images/Pregnancy by week/28-week-pregnant.png";
// import week29 from "../images/Pregnancy by week/29-week-pregnant.png";
// import week30 from "../images/Pregnancy by week/30-week-pregnant.png";
// import week31 from "../images/Pregnancy by week/31-week-pregnant.png";
// import week32 from "../images/Pregnancy by week/32-week-pregnant.png";
// import week33 from "../images/Pregnancy by week/33-week-pregnant.png";
// import week34 from "../images/Pregnancy by week/34-week-pregnant.png";
// import week35 from "../images/Pregnancy by week/35-week-pregnant.png";

export default class Responsive extends Component {
  render() {
    var settings = {
      dots: true,
      infinite: false,
      speed: 800,
      slidesToShow: 4,
      slidesToScroll: 4,
      initialSlide: 0,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    };
    return (
      <div>
        <h2 className="main-head2"> First Trimester</h2>
        <Slider {...settings}>
          <div>
            <img src={week1} />
            <h3 className='byweek'>Week 1</h3>
          </div>
          <div>
          <img src={week2} />
            <h3 className='byweek'>Week 2</h3>
